■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">シマノ (SHIMANO) トラウトワン NS (TROUT ONE NS) / トラウトロッド <br /><br />最近主流となっている昨今のヘビーウェイトルアー主体の釣りに向け、ティップをソフトにしベリーに張りを持たせたファーストテーパーアクションを採用。「ソフチューブトップ」をスピニング2ピースモデルとベイトモデルに搭載し、ヘビーシンキングミノーはもとより様々なルアーの操作性とノリのよさを実現。さらに、全アイテム「ハイパワーＸ」を全身に纏い、ネジレのない高精度キャストと強さを備えています。また、スピニング2ピースモデルには、感度が高く握りやすい「エアフェクトシートCI4+」を、ベイトモデルには、軽くて握りやすいCI4+素材の「ファイティンググリップＴｙｐeR」を搭載。ラインナップも渓流・湖・中流域・大河川までを視野に入れた9アイテムから選べます。「トラウトワンNS」のクラスを超えたパフォーマンスをお試しください。<br /><br />■ハイパワーX<br />■ソフチューブトップ(S100MH・S120Hを除く)<br />■アクティブフェルール(S100MH・S120Hを除く)<br />■3ピース並継(S100MH・S120H)<br />■ステンレスフレームアルコナイトリング(ﾄｯﾌﾟはSiC)<br />■エアフェクトシートCI4+シート(2ピーススピニングモデル)<br />■DPSシート(S100MH・S120H)<br />■ファイティンググリップTypeR(ベイトモデル)<br />■EVAグリップ(S100MH・S120H)<br />■専用ロッド袋 <br /><br />■発売年：2017年 </font></td></tr></table><STYLE type="text/css">
