■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">シマノ (SHIMANO)  17エクスプライド (EXPRIDE) / バス用ベイトロッド<br /><br />人気のエクスプライドが、全アイテムに新設計を施し生まれ変わりました。高弾性カーボンの比率を上げたブランクスをハイパワーXで強化。剛性はそのままに最大10％以上の軽量化と高バランス化に成功。さらにパワーを維持しつつシャープネスと感度、レスポンスが飛躍的に向上しました。 CI4+素材を用いた新型リールシートは軽量化と美観アップに貢献。マットラバーコーティングにより質感にも磨きが掛かりました。テクニックに合わせてアイテムそれぞれに専用設計を採用。7ft未満のアイテムはタフなフィールドを攻略する繊細なロッドアクション、7ft以上はビッグレイクや本場アメリカのビッグバスを想定したパワー重視の設計です。<br /><br />■ハイパワーX<br />■パーフェクションシートXT<br />■ステンレスフレームSiCガイド（セミマイクロガイド仕様）<br />■マイクロガイド仕様（BFS）<br />■TAFTECソリッドティップ（263L-S・263L-S/2）<br />■シェイク性能と感度を高めるEXCITE TOP搭載（265UL+）<br />■グリップジョイント（7ft以上） <br /><br />168MH／168MH-2<br />軽量かつシャープなジグ&ワーミングのスペシャルロッドです。ややパワーを持たせたティップはボトム感知能力に長け、ブレを抑えたベリー～バットは精度の高い操作を可能にします。ビッグバスの口にしっかりとフックを貫通させることができ、バラシも低減。ジグ&ワーミングへの対応力はもちろん、ワイヤーベイトなどでウィードを切りながら一定レンジを高精度にサーチする釣りにも威力を発揮します。<br /><br />■発売年：2017年</font></td></tr></table><STYLE type="text/css">
